function abs_distance(lhs, rhs) {
    var ret = 0;
    var j = 0;
    for (var i = 0; i < lhs.length; i += 4) {
        var z = Math.round(lhs[i] + lhs[i + 1] + lhs[i + 2] * 0.33333333333333);
        ret += Math.abs(z - rhs[j]);
        j++;
    }
    return ret;
}

function idf(data) {
    var z = -1;
    var dis = Infinity;
    for (var i = 0; i < 10; ++i) {
        d = abs_distance(data, x[i]);
        if (d < dis) {
            dis = d;
            z = i;
        }
    }
    return z;
}

